import logo from './logo.svg';
import './App.css';

function App() {

  fetch("./posts.json").then(response => {
    console.log(response);
  })
  return (

    <div className="App"> 
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello World!
        </p>
      </header> 
    </div>
  );
}

export default App;
